            <p>Tenho 21 anos, moro em Minas Gerais e gosto de jogar</p>
            <h2>Minhas Habilidades</h2>
            <ul>
                <li>Ser chato</li>
                <li>Irritar as pessoas</li>
                <li>Acho que só</li>
            </ul>
        </div>
    )
  }
}

export default About;
